            value={ searchBoxData }
            onChange={ onInputChange }
          />
          <select
            id="cardRare-input"
            data-testid="rare-input"
            name="cardRare"
            value={ cardRare }
            onChange={ onInputChange }
          >
            <option>Normal</option>
            <option>Raro</option>
            <option>Muito raro</option>
          </select>
      </div>
    );
